- column_name: stripped_path
  verbose_name: null
  is_dttm: null
  is_active: null
  type: null
  advanced_data_type: null
  groupby: true
  filterable: true
  expression: "CASE\n    WHEN url_path LIKE '/superset/csv/%' THEN '/superset/csv/%'\n\
    \    WHEN url_path LIKE '/superset/extra_table_metadata/%' THEN '/superset/extra_table_metadata/%'\n\
    \    WHEN url_path LIKE '/superset/dashboard/%' THEN '/superset/dashboard/%'\n\
    \    WHEN url_path LIKE '/api/v1/database/%/table/%/%/' THEN '/api/v1/database/%/table/%/%/'\n\
    \    WHEN url_path LIKE '/superset/tables/%' THEN '/superset/tables/%'\n    WHEN\
    \ url_path LIKE '/api/v1/dashboard/%/charts' THEN '/api/v1/dashboard/%/charts'\n\
    \    WHEN url_path LIKE '/superset/filter/table/%' THEN '/superset/filter/table/%'\n\
    \    WHEN url_path LIKE '/api/v1/explore/form_data/%' THEN '/api/v1/explore/form_data/%'\n\
    \    WHEN url_path LIKE '/api/v1/dashboard/%/datasets' THEN '/api/v1/dashboard/%/datasets'\n\
    \    WHEN url_path LIKE '/superset/profile/%' THEN '/superset/profile/%'\n   \
    \ WHEN url_path LIKE '/api/v1/dashboard/%' THEN '/api/v1/dashboard/%'\n    WHEN\
    \ url_path LIKE '/superset/explore/p/%/' THEN '/superset/explore/p/%/'\n  ELSE\n\
    \      REGEXP_REPLACE(\n        REGEXP_REPLACE(\n          REGEXP_REPLACE(url_path,\n\
    \            '(/)[0-9.]+?(/|$)', '/{int}/'),\n            '/([0-9A-Za-z]|-){32}[/$]',\
    \ '/{UUID}/'),\n            '/[0-9a-f]{8}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{12}(/|$)',\
    \ '{UUID}'\n      )\n  END"
  description: null
  python_date_format: null
